window.bookSummaryJSON = "<p>\"Amanda Bouchet blasts off with a series that's full of heart, humor, romance, and action.\" (Jennifer Estep, <i>New York Times</i> and <i>USA Today</i> best-selling author of <i>Kill the Queen</i>)</p> <p><b>Tess Bailey: the galaxy's most wanted.</b></p> <p>Captain Tess Bailey is in deep trouble. She and her crew are on the run, pursued by a tyrant who'll take them dead or alive. Tess's best hope is a tall, dark, and much-too-appealing stranger, Shade Ganavan, who says he can help her. But his motivations are far from clear....</p> <p><b>Shade Ganavan: arrogance, charm...and that special something that makes you want to kick him.</b></p> <p>With the dreaded Dark Watch closing in, what Tess and Shade don't know about each other might get them killed...unless they can set aside their differences and learn to trust each other before it's too late.</p>"; 
